//[MiscUserCode] You can add your own definitions of your custom methods or any other code here...
void ThorMainComponent::mouseDown (const MouseEvent& e)
{
	myDragger.startDraggingComponent (getParentComponent(), 0);

	if (e.mods.isPopupMenu())
	{
		PopupMenu m;
        m.addItem (1, "Options", true, false, optionsImage);

		m.addSeparator();

		m.addItem (2, "About", true, false, helpImage);
		m.addItem (3, "Exit", true, false, exitImage);

        const int result = m.show();

		if (result == 1)
		{
			configDialog = new ThorConfigDialog(config);
			configDialog->centreAroundComponent (this, 256, 124);
        }
		else if (result == 2)
		{
			configDialog = new ThorConfigDialog(config, new ThorAbout());
			configDialog->centreAroundComponent (this, 256, 144);
		}
		else if (result == 3)
		{
			if (worker->isThreadRunning())
			{
				worker->signalThreadShouldExit();
				worker->waitForThreadToExit (1000);
			}
			JUCEApplication::quit();
		}
	}
}

void ThorMainComponent::mouseDrag (const MouseEvent& e)
{
	myDragger.dragComponent (getParentComponent(), e);
}

bool ThorMainComponent::isInterestedInFileDrag (const StringArray &files)
{
	if (worker->isThreadRunning())
	{
		Logger::writeToLog (T("thead running, no files drops"));
		return (false);
	}

    for (int i = files.size(); --i >= 0;)
    {
        File f (files[i]);

        if (f.hasFileExtension (T(".ogg")) || f.hasFileExtension (T(".zip")) || f.hasFileExtension (T(".wav")) || f.hasFileExtension (T(".flac")))
			return true;
    }

	return (false);
}

