void ThorMainComponent::filesDropped (const StringArray &files, int x, int y)
{
	Logger::writeToLog (T("filesDropped()"));
	bool proc = false;

	for (int k=0; k<files.size(); k++)
	{
		if (isZip(files[k]))
		{
			if (!proc)
				worker->clearFileList();

			proc = true;
			worker->addFile (files[k]);
		}
		else if (isCompressedAudio(files[k]))
		{
			if (!proc)
				worker->clearFileList();

			proc = true;
			worker->addFile (files[k]);
		}
		else if (isUncompressedAudio (files[k]))
		{
			if (!proc)
				worker->clearFileList();

			proc = true;
			worker->addFile (files[k]);
		}
		else
		{
			worker->clearFileList();
			continue;
		}
		
		thorStop->setVisible (true);
		worker->startThread();
	}
}

bool ThorMainComponent::isZip (File f)
{
	if (f.hasFileExtension (T(".zip")))
	{
		return (true);
	}

	return (false);
}

bool ThorMainComponent::isCompressedAudio (const File f)
{
	if (f.hasFileExtension (T(".flac")) || f.hasFileExtension (T(".ogg")))
	{
		return (true);
	}
	return (false);
}

bool ThorMainComponent::isUncompressedAudio (const File f)
{
	if (f.hasFileExtension (T(".wav")))
	{
		return (true);
	}
	return (false);
}

void ThorMainComponent::changeListenerCallback(void *ptr)
{
	if (ptr == worker)
	{
		progressVar = worker->getProcProgress();
		if (progressVar == 1)
		{
			thorStop->setVisible (false);
		}
		if (progressVar == 0)
		{
			thorDebug->setText (T("d0ne..."), false);
		}
	}
}
